div.div:
Pixel p; // структура будет проинициализирована случайными (если не
// были указаны дефолтные) значениями
Pixel p{}; // то же самое, более предпочитаемое объявление

Pixel p{0, 255, 0, 1.f};
// структура будет проинициализирована последовательно указанными
// значениями (red = 0, green = 255, blue = 0, transparency = 1.f)

Pixel p{.red = 255, .transparency = 0.f};
// поля red и transparency будут проинициализированы соответствующими
// значениями, все остальные неявно будут проинициализированы
// дефолтными значениями (0 если значение не указано явно)

Pixel p{.transparency = 0.f, .red = 255 };
// ошибка компиляции, порядок инициализации должен совпадать с
// порядком объявления полей в структуре
